import {Route, Routes} from "react-router-dom";
import Home from "../components/home/Home";
import Dialogs from "../components/dialogs/Dialogs";
import Dialog from "../components/dialog/Dialog";
import {hasRole, isAuthenticated} from "../services/auth/auth";
import UsersList from "../components/userslist/UsersList";
import Profile from "../components/profile/Profile";
import {Login} from "../components/login/Login";
import main_pageComponent from "../components/mainPage/main_page.component";

const MainPageRoutes = ({user}) => {
  return (
      <Routes>
        <Route exact path="/" element={main_pageComponent()}/>
        <Route path="/login" element={<Login/>}/>
        {isAuthenticated(user) && <Route path='/dialogs' element={Dialogs()}/>}
        {isAuthenticated(user) && <Route path='/dialogs/:id'
                                         element={<Dialog/>}/>}
        {hasRole(user, ['admin']) && <Route path='/users'
                                            element={<UsersList/>}/>}
        {isAuthenticated(user) && <Route path='/profile'
                                         element={Profile({user: user})}/>}

      </Routes>
  );
};

export default MainPageRoutes;
